import {Routes, Route} from "react-router-dom";
import AllMeetUpsPage from "./pages/AllMeetUps";
import NewMeetUpPage from "./pages/NewMeetUps";
import Favourites2 from "./pages/Fav";

function App() {
  return (
      <div>
        <Routes>
          <Route path='/'>
            <AllMeetUpsPage />
          </Route>
          <Route path='/new'>
            <NewMeetUpPage />
          </Route>
          <Route path='/fav'>
            <Favourites2 />
          </Route>
        </Routes>


  </div>
  );
}

export default App;
